import React from "react";

const About = () => {
  return (
    <div className="bg-teal-100 h-100 p-10 ">
      <h1 className="font-body text-4xl mb-4">About Us</h1>
      <p className="text-lg mb-4">
        Not sure what to cook using the ingredients you have at home? Find
        healthy and delicious recipes here! Cooking more meals at home gives
        everyone in the family an opportunity to build better eating habits, one
        plate at a time.
      </p>
    </div>
  );
};

export default About;
